import { Fragment } from "react";
import hero1 from "./assets/hero1.png";

const Ganadores = () => {
  return (
    <Fragment>
      <div className="ganadores-container">
        <div className="hero">
          <img src={hero1} alt="Honor logo" className="ganadores-img" />;
        </div>
      </div>

      <div className="lista">
        <div>
          <p>Carlos Quirós Sáenz</p>
        </div>
      </div>
    </Fragment>
  );
};

export default Ganadores;
